import React, {Component} from 'react';
import './Footer.less';
import {Tabbar, TabbarItem} from '@vkontakte/vkui';
import {BROADCAST, COMMENTS, MORE, NEWS, TABLES, WELCOME} from '../../constants/navigation';

class Footer extends Component {
    constructor(props) {
        super(props);

        this.state = {
            isNavigation: false,
        };
    }

    componentDidMount() {
        setTimeout(() => {
            this.setState({isNavigation: true});
        }, 1500);
    }

    onChangePanel = path => {
        if (path !== this.props.activePanel && this.state.isNavigation) {
            this.setState({
                isNavigation: false,
            }, () => {
                setTimeout(() => {
                    this.setState({isNavigation: true});
                }, 1000);
                this.props.navigationPanel(path);
            });
        }
    };

    render() {
        if (this.props.activePanel === COMMENTS || this.props.activePanel === WELCOME) return null;

        return (
            <Tabbar>
                <TabbarItem
                    onClick={() => !this.state.isNavigation || this.onChangePanel(NEWS)}>
                    <div className={!this.state.isNavigation && this.props.activePanel === NEWS ?
                        'TabbarItem-active' : 'TabbarItem-no-active'}>
                        <div className="footer-ico">
                            <NewsIco isActive={this.props.activePanel === NEWS}/>
                        </div>
                    </div>
                </TabbarItem>

                <TabbarItem
                    onClick={() => !this.state.isNavigation || this.onChangePanel(BROADCAST)}>
                    <div className={!this.state.isNavigation && this.props.activePanel === BROADCAST ?
                        'TabbarItem-active' : 'TabbarItem-no-active'}>
                        <div className="footer-ico">
                            <BroadcastIco isActive={this.props.activePanel === BROADCAST}/>
                        </div>
                    </div>
                </TabbarItem>

                <TabbarItem
                    onClick={() => !this.state.isNavigation || this.onChangePanel(TABLES)}>
                    <div className={!this.state.isNavigation && this.props.activePanel === TABLES ?
                        'TabbarItem-active' : 'TabbarItem-no-active'}>
                        <div className="footer-ico">
                            <TablesIco isActive={this.props.activePanel === TABLES}/>
                        </div>
                    </div>
                </TabbarItem>

                <TabbarItem
                    onClick={() => !this.state.isNavigation || this.onChangePanel(MORE)}>
                    <div className={!this.state.isNavigation && this.props.activePanel === MORE ?
                        'TabbarItem-active' : 'TabbarItem-no-active'}>
                        <div className="footer-ico">
                            <MoreIco isActive={this.props.activePanel === MORE}/>
                        </div>
                    </div>
                </TabbarItem>
            </Tabbar>
        );
    }
}

export default Footer;

